import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="header">
        <div><b>Bear Pals</b></div>
        <hr></hr>
        <div>We match you with study groups to help you ace your classes.</div>
      </div>
    </div>
  );
}

export default App;
